import { TextField } from "@mui/material";
const Input = ({ name, value, label, type, error, onChange }) => {
  error = null;
  return (
    <div>
      {(error && (
        <TextField
          error
          name={name}
          id="outlined-error-helper-text"
          label="Error"
          helperText="Incorrect entry."
        />
      )) || (
